import React from "react";
import { useSelector, shallowEqual } from "react-redux";

const useProfile = () => {
  return useSelector(
    (state) => ({
      form: state.form,
    }),
    shallowEqual
  );
};
const Profile = () => {
  const { form } = useProfile();
  return (
    <div>
      <h1>Profile</h1>
      <h1>{form.firstName}</h1>
    </div>
  );
};
export default Profile;
